about:
Prova Impar is an individual & family services company based out of Urbanização do Feital , Lote 34, Porta 48 Frossos Braga 

A Prova Ímpar desenvolve as seguintes atividades:
•        Inspeção de Atribuição de Matricula a MAQUINAS INDUSTRIAS;
•        Homologação e Alteração de Características a Veículos no Livrete (IMT), nomeadamente alteração de medida de Pneumáticos, pesos brutos, alteração do tipo de caixa;
•        Ensaios a Veículos;
•        Calibração de Equipamentos de Oficinas e Centros de Inspeção;
•        Inspeção a Equipamentos Sob Pressão (ESP);
•        Inspeção ADR _ transporte de mercadorias Perigosas;
•        Inspeção a Pulverizadores (Aplicação de produtos farmacêuticos);
•        Inspeção à Instalação de GÁS NATURAL em Veículos GNC e GNL;
•        Inspeções ao DL.50/2015;
•        Verificação Metrológica de Tacógrafos;
•        Verificação Metrológica de Taxímetros;
•        Peritagens a acidentes;
•        Ensaios e Certificação de Acordo com o ATP; (Transportes de Mercadorias Perecíveis) UNECE
